Podavach Loader fixes the problem of reloading by fingers.
 
Podavach allows you to:
Load AK and AR magazines quickly (less than 15 seconds)
Not a problem to load with one hand or wearing gloves
Dozens of magazines charged without losing speed
 
Features:
Charges your magazine in less than 15 seconds;
Fits all types of AK and most of AR15 magazines;
Loads AK(7.62,5.45) and AR15(5.56, 300 blk) rounds;
Has high-quality finishing makes it totally waterproof and durable;
Pusher is held by magnet which excludes the possibility of it being lost;
20000 loaded magazines warranty;
 
And more:
Lighter than a loaded mag;
Has useful ergonomic handles;
Engraved ammo quantity indicators;
Easy to use in gloves in cold weather;
6 rubber feet protect loader from sliding;
Easy to load on the table as well as on the knees;
 
Price starts from $69.
 
This is a first multi-caliber loader on market. It has been battle tested and endorsed by Ukrainian soldiers on the front line, polygons and shooting ranges.
 
Also, no other loader in the world fits to any type of AK and AR15 magazines (plastic, metal, bakelite, aluminium) and calibers(5.45, 7.62, 5.45) simultaneously.
 
